import React, {Component} from 'react';
import './App.css';

class About extends Component {

  styles = {
    image: {
      width: 200,
      height: 150
    }
  };

render() {
	return(
    <div>
      <center><h1>About Us</h1></center>
      <hr></hr>
      <img class = "img-thumbnail" src = {require("./photos/Alex.jpeg")} style = {this.styles.image}/>
    </div>

	)
}

}



export default About;
